import React from 'react';
import {Container,AppBar,Typography,Grow,Grid} from '@material-ui/core';
import souvenir from './images/souvenir.png';
import photostring from './images/photo-string.jpg';
import Posts from './components/Posts/posts.js';
import Form from './components/Form/form.js';
import useStyles from './styles';

const App=()=>{
  const classes=useStyles
    return(
        <Container maxWidth="lg">
          <AppBar position='static' color='inherit'>
           <Typography varient="h2" align='center'>Souvenir</Typography>
           <img src={photostring} alt="souvenir" height="200"></img>
          </AppBar>
          <Grow in>
            <Container>
                <Grid container justifyContent='space-between' alignItems='stretch' spacing={3}></Grid>
                <Grid item xs={12} sm={7}>
                   <Posts/>
                </Grid>
                <Grid item xs={12} sm={4}>
                   <Form/>
                </Grid>

            </Container>
          </Grow>
        </Container>
    )
}

export default App;
